import React from 'react';
import * as d3 from 'd3';
import styles from "./style.js";

export default class Titles extends React.PureComponent {
  constructor(props) {
    super(props);
    this.references = { title: React.createRef() };
  }

  componentDidMount() {
  }


  render() {
    return (
      <g>
      <text ref={this.references.title}
        x= "25%"
        y= "10%"
        width="50%"
        height="10%"
        style={styles.text}
        >
          Zwarte mensen
        </text>

      <text ref={this.references.title}
        x= "75%"
        y= "10%"
        width="50%"
        height="10%"
        style={styles.text}
        >
          Witte mensen
        </text>
      </g>
    );
  }
}
